import React from "react";
import "./about.css";

const About = () => {
  return (
    <div className="about--container">
      <div className="about--game-info-container">
        <h1>Information about the game</h1>
        <div>
          <h2>Description</h2>
          <p>
            Step into the mysterious world of professional development with
            "Portfolio Pursuit: The Slender Career." This unique and thrilling
            game takes the spine-tingling concept of the Slender Man and melds
            it with your journey to build a killer career portfolio. Will you be
            able to navigate through the shadowy woods of your chosen field,
            collect vital artifacts, and avoid the looming specter of career
            stagnation?
          </p>
        </div>
        <div>
          <h2>Gameplay</h2>
        </div>
        <div>
          <h2>End notes</h2>
        </div>
      </div>
    </div>
  );
};

export default About;
